sc_cat_item_producer.script:
var Divider    = "\n\n--------------------------------------------------";
var SSN        = "\nLast 4 SSN: \t\t";
var DOB        = "\nDate of birth: \t\t";
var Phone      = "\nPhone number: \t";
var Email      = "\nEmail address: \t\t";
var CostCenter = "\nCost center: \t\t";
var Postal     = "\nPostal address: \n";

var notes = Divider;

notes += SSN        + producer.snn_four.getDisplayValue();
notes += DOB        + producer.birth_date.getDisplayValue();
notes += Phone      + producer.phone_number.getDisplayValue();
notes += Email      + producer.email_address.getDisplayValue();
notes += CostCenter + producer.cost_center.getDisplayValue();
notes += Postal     + producer.postal_address.getDisplayValue();

// Add the request specific fields to the customer notes
current.description += notes;

// Set the default assignment group to Regulatory
current.assignment_group.setDisplayValue('Regulatory-All');

producer.redirect = "catalog_home.do?sysparm_catalog=95812d86134c0b00d80074c66144b0b3";
